import React from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import { createStore } from "redux";
import rootReducer from "./reducers"; // Đảm bảo bạn đã import reducer của mình tại đây
import App from "./App"; // Thay thế App bằng tên của ứng dụng chính của bạn nếu cần thiết

const store = createStore(rootReducer); // Tạo store Redux

ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  document.getElementById("root")
);
